export const Paginado = ({
  dogsCardsPerPage,
  allDogs,
  paginado,
  paginadoPrev,
  paginadoNext,
  currentPage,
}) => {
  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(allDogs / dogsCardsPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <nav>
      <div>
        <div className="btn btn-primary" onClick={paginadoPrev}>
        </div>
        {pageNumbers.map((number) => (
          <div className="btn btn-primary"
            key={number}
            onClick={() => paginado(number)}
          >
            {number}
            <p>{number}</p>
          </div>
        ))}
        <div className="btn btn-primary" onClick={paginadoNext}>
        </div>
      </div>
    </nav>
  );
};
